import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import TechnicalProcesses from './components/TechnicalProcesses';
import HomePage from './pages/HomePage';
import ServicesPage from './pages/ServicesPage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import './styles/index.css';

function App() {
  // Import new pages
  const DistillationPage = require('./pages/DistillationPage').default;
  const ExtractionPage = require('./pages/ExtractionPage').default;
  const ReactionPage = require('./pages/ReactionPage').default;
  const RatingCurvesPage = require('./pages/RatingCurvesPage').default;
  const QMRAAnalysisPage = require('./pages/QMRAAnalysisPage').default;
  const MechanisticAnalysisPage = require('./pages/MechanisticAnalysisPage').default;
  const MachineLearningPage = require('./pages/MachineLearningPage').default;

  return (
    <Router>
      <div className="app">
        <Navbar />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/services" element={<ServicesPage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/contact" element={<ContactPage />} />
            {/* Process Unit Pages */}
            <Route path="/distillation" element={<DistillationPage />} />
            <Route path="/extraction" element={<ExtractionPage />} />
            <Route path="/reaction" element={<ReactionPage />} />
            {/* Data Analysis Pages */}
            <Route path="/rating-curves" element={<RatingCurvesPage />} />
            <Route path="/qmra" element={<QMRAAnalysisPage />} />
            <Route path="/mechanistic-analysis" element={<MechanisticAnalysisPage />} />
            <Route path="/machine-learning" element={<MachineLearningPage />} />
          </Routes>
        </main>
        <TechnicalProcesses />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
